import React from "react";
import { useParams } from "react-router-dom";

function SchedulePage() {
    const { rows } = useParams();
    const parsedRows = JSON.parse(rows || "[]"); // Use an empty array as the default value

  console.log("parsed rows are")
  console.log(parsedRows);
  return (
    <div>
      <h1>Your Schedule</h1>
      <div>
      <div className="table-container">
        <table className="task-table">
          <thead>
            <tr>
              <th>Time</th>
              <th>Task</th>
              <th>Goal</th>
            </tr>
          </thead>
          <tbody>
            {rows.map((row, index) => (
              <tr key={index}>
                <td>
                  <input
                    type="time"
                    value={row.time}
                    onChange={(e) => handleRowChange(index, 'time', e.target.value)}
                  />
                </td>
                <td>
                  <input
                    type="text"
                    value={row.task}
                    onChange={(e) => handleRowChange(index, 'task', e.target.value)}
                  />
                </td>
                <td>
                  <input
                    type="text"
                    value={row.goal}
                    onChange={(e) => handleRowChange(index, 'goal', e.target.value)}
                  />
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
      </div>
    </div>
  );
}

export default SchedulePage;
